import React from "react";
import { useNavigate } from "react-router-dom";
import "../css/HomePage.css";


function HomePage() {
  const navigate = useNavigate();

  return (
    <div className="homepage">
      {/* Navbar */}
      <header className="navbar">
        <h1>üìì My Diary App</h1>
        <nav className="nav-links">
          <button onClick={() => navigate("/")}>Home</button>
          <button onClick={() => navigate("/login")}>Sign In</button>
          <button onClick={() => navigate("/register")}>Sign Up</button>
          <button
            onClick={() => {
              const section = document.querySelector(".about");
              section && section.scrollIntoView({ behavior: "smooth" });
            }}
          >
            About
          </button>
          <button
            onClick={() => {
              const section = document.querySelector(".contact");
              section && section.scrollIntoView({ behavior: "smooth" });
            }}
          >
            Contact
          </button>
          <button
            onClick={() => {
              const section = document.querySelector(".feedback");
              section && section.scrollIntoView({ behavior: "smooth" });
            }}
          >
            Feedback
          </button>
        </nav>
      </header>

      {/* Banner */}
      <section className="image-banner">
        <img src={bannerImage} alt="Diary Banner" />
      </section>

      {/* About Section */}
      <section className="about">
        <h2>About My Diary App</h2>
        <p>
          Keep track of your thoughts and memories with ease. Our diary app is
          private, secure, and always accessible. Write your daily experiences
          and reflect anytime, anywhere.
        </p>
      </section>

      {/* Contact Section */}
      <section className="contact">
        <h2>Contact Us</h2>
        <p>
          <strong>Team MyDiary</strong> <br />
          üìß support@mydiaryapp.com
        </p>
        <p>
          <a
            href="https://www.linkedin.com/"
            target="_blank"
            rel="noopener noreferrer"
          >
            LinkedIn
          </a>
        </p>
      </section>

      {/* Feedback Section */}
      <section className="feedback">
        <h2>Feedback</h2>
        <textarea
          placeholder="Tell us what you think..."
          rows="4"
        ></textarea>
        <br />
        <button>Submit</button>
      </section>

      {/* Footer */}
      <footer>
        <p>¬© 2025 My Diary App | Built with ‚ù§Ô∏è</p>
      </footer>
    </div>
  );
}

export default HomePage;
